  {
    id: 3,
    emoji: "🤣",
    name: "Rolling On The Floor, Laughing",
    meaning:
      "This is funny! A smiley face, rolling on the floor, laughing. The face is laughing boundlessly. The emoji version of “rofl“. Stands for „rolling on the floor, laughing“."
  },
  {
    id: 4,
    emoji: "😖",
    name: "Confounded Face",
    meaning:
    "'How on earth could that happen? This emoji 😖 expresses strong emotions such as frustration, anger, and helplessness. The X-shaped, narrowed eyes and pinched mouth give the impression that it is shaking with rage or holding back tears. Makes you wonder, “How did this happen? Can be used to show extreme anger when the proverbial barrel has burst. It represents feeling overwhelmed by'"
